const MemoryCard = ({ image, onAdd }) => {
    return (
        <div onClick={() => onAdd(image.id)} className='card my-2 py-1-2'>
            <div className='container flex'>
                <img src={image.src} alt={image.charname}></img>
                <h1>{image.charname}</h1>
            </div>
        </div>
    )
}

export default MemoryCard
